 your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]], \"227\" [:div [:p] [:div [:p/code {:code \"^kind/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}]] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"263\" [:div [:p] nil nil [:p/markdown \"### total\"]], \"157\" [:div [:p] nil nil [:p/markdown \"#### eval-and-realize-notes-from-change\\n\\n Use `notespace.api/eval-and-realize-notes-from-change` to evaluate and realize all notes starting from the line where the file has changed in its last save, compared to the previous save.\"]], \"185\" [:div [:p] [:div [:p/code {:code \"^kind/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}]] nil [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]], \"266\" [:div [:p] nil nil [:p/markdown \"## External files (experimental)\\n\\nSupport for external files is still considered experimental. The API will stabilize soon.\"]], \"175\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}]] nil [:big [:big 3]]], \"155\" [:div [:p] nil nil [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-re ) \\n\\n  (notespace/update-config #(assoc % :evaluation-callback-fn\\n                             (fn [idx note-count note]\\n                               (let [expected-duration (or  (get-in note [:duration]) 0)]\\n                                 (println \\\"evaluate note: \\\" idx \\\"/\\\" (dec note-count)\\n                                          \\\", expected duration (s): \\\"\\n                                          (if (pos? expected-duration)\\n                                            expected-duration\\n                                            \\\"???\\\"))))))\\n\\n  (notespace/update-config #(assoc % :in-eval-count-down-fn\\n                           (fn [seconds]\\n                             (println seconds))))\\n  (reset! state/the-context\\n          (fx/swap-context @state/the-context\\n                           #(-> % (assoc-in [:config :render-src?] false)))))\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"nil\\n\"}]], \"207\" [:div [:p] nil nil [:p/markdown \"### code\"]], \"238\" [:div [:p] nil nil [:p/markdown \"## Overriding note kinds at runtime\\nIt is possible to override a note's kind during its evaluation using the `notespace.kinds/override` functions.\"]], \"270\" [:div [:p] [:div [:p/code {:code \"^kind/void\\n(spit (notespace/file-target-path \\\"dummy.txt\\\")\\n      \\\"hi!\\\")\", :bg-class \"bg-light\"}]] nil nil], \"231\" [:div [:p] nil nil [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]], \"251\" [:div [:p] [:div [:p/code {:code \"^just-code\\n[:div \\\"just some code\\\"]\", :bg-class \"bg-light\"}]] nil nil], \"169\" [:div [:p] [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}]] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"{:x 3}\\n\"}]], \"232\" [:div [:p] nil nil [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]], \"274\" [:div [:p] nil nil [:p/markdown \"Now we can include file links and images as follows:\"]], \"179\" [:div [:p] nil nil [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]], \"156\" [:div [:p] nil nil [:p/markdown \"#### eval-and-realize-notes-from-line\\n\\nUse `notespace.api/eval-and-realize-notes-from-line` to evaluate and realize all notes starting from a certain line, and inform Notespace.\"]], \"159\" [:div [:p] nil nil [:p/markdown \"### Delays\"]], \"221\" [:div [:p] nil nil [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]], \"162\" [:div [:p] nil nil [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]], \"192\" [:div [:p] nil nil [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]], \"213\" [:div [:p] [:div [:p/code {:code \"^kind/code\\n(pr-str '(defn abcd [x] (+ x 9)))\", :bg-class \"bg-light\"}]] nil [:p/code \"(defn abcd [x] (+ x 9))\"]], \"167\" [:div [:p] nil nil [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]], \"259\" [:div [:p] [:div [:p/code {:code \"(require '[midje.sweet :refer [fact]])\", :bg-class \"bg-light\"}]] nil nil], \"197\" [:div [:p] nil nil [:p/markdown \"### sci\\n\\nWe can use the [Small Clojure Interpreter](https://github.com/borkdude/sci) to run code on the browser side:\"]], \"249\" [:div [:p] [:div [:p/code {:code \"(def ^{:doc \\\"When making a user extensible kind, you MUST assign the keyword\\nto a variable. Annotating with a keyword WILL NOT WORK!\\\"} just-code ::just-code)\", :bg-class \"bg-light\"}]] nil nil], \"268\" [:div [:p] [:div [:p/code {:code \"(notespace/file-target-path \\\"dummy.txt\\\")\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"\\\"resources/public/notespace-files/dummy.txt\\\"\\n\"}]], \"226\" [:div [:p] nil nil [:p/markdown \"--------------------\"]], \"228\" [:div [:p] nil nil [:p/markdown \"--------------------\"]], \"244\" [:div [:p] [:div [:p/code {:code \"(require '[notespace.behavior])\", :bg-class \"bg-light\"}]] nil nil], \"225\" [:div [:p] [:div [:p/code {:code \"^kind/dataset-grid\\n{:a [1 2 3]\\n :b [4 5 6]}\", :bg-class \"bg-light\"}]] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"203\" [:div [:p] [:div [:p/code {:code \"^kind/quil\\n{:draw         '(fn [{:keys [circles]}]\\n                 (q/background 255)\\n                 (doseq [{[x y] :pos [r g b] :color} circles]\\n                   (q/fill r g b)\\n                   (q/ellipse x y 10 10)))\\n :update-state '(fn [{:keys [width height] :as state}]\\n                 (update state :circles conj {:pos   [(+ 20 (rand-int (- width 40)))\\n                                                      (+ 20 (rand-int (- height 40)))]\\n                                              :color (repeatedly 3 #(rand-int 250))}))\\n :init         '(fn [width height]\\n                 (fn []\\n                   {:width   width\\n                    :height  height\\n                    :circles []}))}\", :bg-class \"bg-light\"}]] nil [:p/quil {:draw (fn [{:keys [circles]}] (q/background 255) (doseq [{[x y] :pos, [r g b] :color} circles] (q/fill r g b) (q/ellipse x y 10 10))), :update-state (fn [{:keys [width height], :as state}] (update state :circles conj {:pos [(+ 20 (rand-int (- width 40))) (+ 20 (rand-int (- height 40)))], :color (repeatedly 3 (fn* [] (rand-int 250)))})), :init (fn [width height] (fn [] {:width width, :height height, :circles []}))}]], \"172\" [:div [:p] nil nil [:p/markdown \"### Promises\\nComing soon.\"]], \"278\" [:div [:p] nil nil [:p/markdown \"When rendering to static HTML, the external files will be moved alongside it, so that the same links work.\"]], \"176\" [:div [:p] nil nil [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]], \"247\" [:div [:p] nil nil [:p/markdown \"## Extending Notespace with new note kinds.\"]], \"212\" [:div [:p] [:div [:p/code {:code \"^kind/code\\n[\\\"(defn abcd [x] (+ x 9))\\\"\\n \\\"(defn abcd [x] (+ x 3))\\\"]\", :bg-class \"bg-light\"}]] nil [:div [:p/code \"(defn abcd [x] (+ x 9))\"] [:p/code \"(defn abcd [x] (+ x 3))\"]]], \"145\" [:div [:p] nil nil [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]], \"199\" [:div [:p] [:div [:p/code {:code \"^kind/sci\\n[:div [:big[:big '(+ 1 2)]]]\", :bg-class \"bg-light\"}]] nil [:p/sci [:div [:big [:big (+ 1 2)]]]]], \"210\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"def abcd(x):\\n  return x+9\\\"\\n {:language :python}]\", :bg-class \"bg-light\"}]] nil [:p/code \"def abcd(x):\\n  return x+9\" {:language :python}]], \"186\" [:div [:p] nil nil [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]], \"261\" [:div [:p] nil nil [:p/markdown \"We can ask for the summary of all midje tests:\"]], \"152\" [:div [:p] [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}]] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"12\\n\"}]], \"181\" [:div [:p] nil nil [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]], \"184\" [:div [:p] [:div [:p/code {:code \"^kind/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}]] nil [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]], \"173\" [:div [:p] nil nil [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]], \"246\" [:div [:p] [:div [:p/code {:code \"(DummyType1. [:big [:big 3]])\", :bg-class \"bg-light\"}]] nil [:big [:big 3]]], \"190\" [:div [:p] nil nil [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]], \"222\" [:div [:p] nil nil [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value which is one of the following:\\n- a map, whose values are same-length sequentials (one example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries);\\n- a sequence of maps.\\n\\nThey render that values as an [ag-Grid](https://www.ag-grid.com/) table view.\\n\\nFor example:\"]], \"250\" [:div [:p] nil nil [:p/markdown \"An example of properly annotated form with a variable that resolves to a keyword which is attached to a kind->behavior method:\"]], \"148\" [:div [:p] [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}]] nil nil], \"267\" [:div [:p] nil nil [:p/markdown \"To put files under your local project directory, in a place that is accessible to notespace, please use the `notespace.api/file-target-path` function.\"]], \"208\" [:div [:p] nil nil [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]], \"276\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:button (notespace/file-link-tag \\\"download dummy.txt\\\" \\\"dummy.txt\\\")]\", :bg-class \"bg-light\"}]] nil [:button [:a {:href \"notespace-files/dummy.txt\"} \"download dummy.txt\"]]], \"140\" [:div [:p] nil nil nil], \"166\" [:div [:p] nil nil [:p/markdown \"### Atoms\"]], \"218\" [:div [:p] nil nil [:p/markdown \"We can also have notes of math kind:\"]], \"194\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}]] nil [:ul [:li 0 \" \" [:p/spark    (kind/override kind/vega))\", :bg-class \"bg-light\"}]] nil [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"154\" [:div [:p] nil nil [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]], \"257\" [:div [:p] [:div [:p/code {:code \"(notespace/clojure-tests-summary)\", :bg-class \"bg-light\"}]] nil [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkgreen\"}} \"âœ“\"]] \": \" 1]]]], \"209\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"(defn abcd [x] (+ x 9))\\\"]\", :bg-class \"bg-light\"}]] nil [:p/code \"(defn abcd [x] (+ x 9))\"]], \"239\" [:div [:p] [:div [:p/code {:code \"(-> [:big [:big 3]]\\n    (kind/override kind/hiccup))\", :bg-class \"bg-light\"}]] nil [:big [:big 3]]], \"240\" [:div [:p] [:div [:p/code {:code \"(-> [\\\"(ax ^2 + bx + c = 0 )\\\"]\\n    (kind/override kind/math))\", :bg-class \"bg-light\"}]] nil [:div [:p/math \"(ax ^2 + bx + c = 0 )\"]]], \"271\" [:div [:p] [:div [:p/code {:code \"(require '[clojure.java.io :as io])\", :bg-class \"bg-light\"}]] nil nil], \"174\" [:div [:p] [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}]] nil nil], \"171\" [:div [:p] [:div [:p/code {:code \"^kind/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}]] nil nil], \"200\" [:div [:p] nil nil [:p/markdown \"### Quil (experimental)\"]], \"183\" [:div [:p] nil nil [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]], \"223\" [:div [:p] [:div [:p/code {:code \"^kind/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}]] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.17734828679550674, \"z\" \\a} {\"x\" 1, \"y\" 0.39297536740693295, \"z\" \\b} {\"x\" 2, \"y\" 0.09265809381930112, \"z\" \\c} {\"x\" 3, \"y\" 0.6169608443534533, \"z\" \\a} {\"x\" 4, \"y\" 0.3943062830542535, \"z\" \\b} {\"x\" 5, \"y\" 0.15879660763177306, \"z\" \\c} {\"x\" 6, \"y\" 0.6161870511233304, \"z\" \\a} {\"x\" 7, \"y\" 0.44879904931281955, \"z\" \\b} {\"x\" 8, \"y\" 0.7285755232323152, \"z\" \\c})}]]], \"272\" [:div [:p] [:div [:p/code {:code \"(defn copy [uri file]\\n  (with-open [in  (io/input-stream uri)\\n              out (io/output-stream file)]\\n    (io/copy in out)))\", :bg-class \"bg-light\"}]] nil nil], \"205\" [:div [:p] nil nil [:p/markdown \"The `vega` kind supports both Vega and Vega-Lite visualizations.\"]], \"229\" [:div [:p] nil nil [:p/markdown \"### Plain html\"]], \"149\" [:div [:p] [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}]] nil nil], \"235\" [:div [:p] nil nil [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]], \"206\" [:div [:p] [:div [:p/code {:code \"^kind/vega\\n{:description \\\"A simple bar chart with embedded data.\\\"\\n :data        {:values [{:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n                        {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n                        {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}]}\\n :mark        :bar\\n :encoding    {:x {:field :a :type :nominal :axis {:labelAngle 0}}\\n               :y {:field :b :type :quantitative}}}\", :bg-class \"bg-light\"}]] nil [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"216\" [:div [:p] nil nil [:p/markdown \"We can also include math tags in Hiccup elements:\"]], \"144\" [:div [:p] nil nil [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]], \"146\" [:div [:p] nil nil [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]], \"217\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:p/math\\n \\\"(ax ^2 + bx + c = 0 )\\\"]\", :bg-class \"bg-light\"}]] nil [:p/math \"(ax ^2 + bx + c = 0 )\"]], \"177\" [:div [:p] [:div [:p/code {:code \"^kind/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"((5 4 4 0 4 2)\\n (5 5 3 3 3 3)\\n (3 1 0 0 2 0)\\n (0 5 3 2 0 1)\\n (5 5 2 2 1 4)\\n (3 4 2 1 2 3))\\n\"}]], \"260\" [:div [:p] [:div [:p/code {:code \"(fact\\n (+ 1 2) => 3)\", :bg-class \"bg-light\"}]] nil [:div [:big [:big {:style {:color \"darkgreen\"}} \"âœ“\"]] \"   true\"]], \"153\" [:div [:p] nil nil [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]], \"254\" [:div [:p] [:div [:p/code {:code \"(require '[clojure.test :refer [deftest testing is are]])\", :bg-class \"bg-light\"}]] nil nil], \"142\" [:div [:p] nil nil [:p/markdown \"## Notes\\n\\nHere is a note:\"]], \"211\" [:div [:p] nil nil [:p/markdown \"Such tags can usually be handled through dedicated kinds too.\"]], \"262\" [:div [:p] [:div [:p/code {:code \"(notespace/midje-summary)\", :bg-class \"bg-light\"}]] nil [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkgreen\"}} \"âœ“\"]] \": \" 1]]]], \"252\" [:div [:p] nil nil [:p/markdown \"## Tests\"]], \"256\" [:div [:p] nil nil [:p/markdown \"We can ask for the summary of all clojure.test tests:\"]], \"269\" [:div [:p] nil nil [:p/markdown \"Let us put some files there.\"]], \"198\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:p/sci '(+ 1 2)]\", :bg-class \"bg-light\"}]] nil [:p/sci (+ 1 2)]], \"220\" [:div [:p] [:div [:p/code {:code \"^kind/math\\n(str \\\"(ax ^2 \\\"\\n     \\\"+ bx \\\"\\n     \\\"+ c \\\"\\n     \\\" = 0)\\\")\", :bg-class \"bg-light\"}]] nil [:p/math \"(ax ^2 + bx + c  = 0)\"]], \"147\" [:div [:p] nil nil [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(dereferenced)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]], \"151\" [:div [:p] [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}]] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] nil], \"233\" [:div [:p] nil nil [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]], \"182\" [:div [:p] nil nil nil], \"264\" [:div [:p] nil nil [:p/markdown \"We can ask for the summary of all tests:\"]], \"189\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}]] nil [:big [:big 3]]], \"255\" [:div [:p] [:div [:p/code {:code \"(deftest t1\\n  (testing \\\"abcd\\\"\\n    (is (= 3 3))))\", :bg-class \"bg-light\"}]] nil [:div [:big [:big {:style {:color \"darkgreen\"}} \"âœ“\"]] \"   true\"]], \"236\" [:div [:p] nil nil [:p/markdown \"## Progress logging\\n\\nThis should be documented better soon.\"]], \"204\" [:div [:p] nil nil [:p/markdown \"### vega\"]], \"143\" [:div [:p] [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"21\\n\"}]], \"178\" [:div [:p] nil nil [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]], \"170\" [:div [:p] nil nil [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]], \"245\" [:div [:p] [:div [:p/code {:code \"(deftype DummyType1 [data]\\n  notespace.behavior/Behaving\\n  (->behavior [this]\\n    {:render-src? true\\n     :value->hiccup (fn [v] data)}))\", :bg-class \"bg-light\"}]] nil nil], \"248\" [:div [:p] [:div [:p/code {:code \"(defmethod\\n  ^{:doc\\n    \\\"Example of user extensible kind.\\nNote the ':reload true' in the :require vector:\\n[notespace.kinds :as k :reload true].\\nThis will make REPL testing your extensible kind easier!\\\"}\\n  kind/kind->behaviour ::just-code\\n  [_]\\n  {:render-src?   true\\n   :value->hiccup (constantly nil)})\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"#multifn[kind->behaviour 0x18f7f35c]\\n\"}]], \"161\" [:div [:p] [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}]] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] nil], \"230\" [:div [:p] [:div [:p/code {:code \"^kind/html\\n(str \\\"<h4>h4</h4>\\\"\\n     \\\"<h5>h5</h5>\\\")\", :bg-class \"bg-light\"}]] nil [:p/html \"<h4>h4</h4><h5>h5</h5>\"]], \"242\" [:div [:p] [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}]] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"(0.28384274228601314\\n 0.23286798640213735\\n 0.4300292405913845\\n 0.22366533939952293\\n 0.681774513967575\\n 0.6139553007753347\\n 0.7097633741503406\\n 0.6016592738301768\\n 1.0584143757654072)\\n\"}]], \"187\" [:div [:p] nil nil [:p/markdown \"* a\\n* b\\n* c\\n* d\"]], \"214\" [:div [:p] nil nil [:p/markdown \"### math\"]], \"164\" [:div [:p] nil nil [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]], \"163\" [:div [:p] nil nil [:p/markdown \"### Futures\"]], \"215\" [:div [:p] nil nil [:p/markdown \"Regular markdown text can contain math expressions using TeX notation: $(ax ^2 + bx + c = 0 )$.\"]], \"243\" [:div [:p] nil nil [:p/markdown \"## Inferring note behaviors from types\\nIt is possible to infer a note's behavior from the type of its rendered, overriding the behavior prescribed by its kind. This can be done by extending the `Behaving` protocol.\"]], \"160\" [:div [:p] nil nil [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]], \"150\" [:div [:p] [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"12\\n\"}]]}}"</script>
